import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import NavBar from "./Component/NavBar";
import Footer from "./Component/Footer";
import Home from "./Component/Home";
import Login from "./Component/Login";
import Logout from "./Component/Logout";
import EventManagement from "./Component/EventManagement";
import Sidenav from "./Component/Sidenav";
import AllStudents from "./Component/AllStudents";
import AboutStudent from "./Component/AboutStudent";
import AllCourses from "./Component/AllCourses";
import FeesCollections from "./Component/FeesCollections";
import AddCourses from "./Component/AddCourses";
import EditCourse from "./Component/EditCourse";
import EditWebinar from "./Component/EditWebinar";
import AddWebinar from "./Component/AddWebinar";
import AllWebinars from "./Component/AllWebinars";
import FeesReceipts from "./Component/FeesReceipts";
import ToolAndFixtureDesign from "./Component/ToolAndFixtureDesign"
import CoureseGetData from "./Component/CoureseGetData"
import AdminSidenavdata from "./Component/AdminSidenavdata"
import UserSidenavbar from "./Component/UserSidenavbar"
import AddAdmin from "./Component/AddAdmin"
import AllPlacements from "./Component/AllPlacements"
import AddPlacements from "./Component/AddPlacements"
import EditAdminData from "./Component/EditAdminData"
import Allwebinarphotos from "./Component/Allwebinarphotos"
import AddwebinarPhotos from "./Component/AddwebinarPhotos"
import StudentsDetails from "./Component/StudentsDetails"
import WebinarsGetData from "./Component/WebinarsGetData"
import CoursesTableData from "./Component/CoursesTableData"
import WebinarsTableData from "./Component/WebinarsTableData"
import AdminSidenaveTable from "./Component/AdminSidenaveTable"
import EmptyPage from "./Component/EmptyPage"
import ControllersTableData from "./Component/ControllersTableData"
import LoginEmp from "./Component/LoginEmp";
import SignUpEmp from "./Component/SignUp";
import ForgotEmp from "./Component/ForgotPassword";
import Courses from "./Component/Courses";
import OnBoarding from "./Component/OnBoarding";
import Profile from "./Component/Profile";

const courseComponents = {
  1: AllCourses,
  2: AddCourses,
  6: AddCourses,
  // Add more mappings as needed
};

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);

  // Load auth status from localStorage once when the app starts
  useEffect(() => {
    const storedAuth = localStorage.getItem("isAuthenticated");
    setIsAuthenticated(storedAuth === "true");
  }, []);

  const handleLogin = () => {
    setIsAuthenticated(true);
    localStorage.setItem("isAuthenticated", "true");
  };

  const handleLogout = () => {
    setIsAuthenticated(false);
    localStorage.removeItem("isAuthenticated");
  };

  return (
    <Router>
      {/* Render NavBar and Sidenav only if authenticated */}
      {isAuthenticated && <NavBar />}
      {isAuthenticated && <Sidenav />}

      <Routes>
        {/* Redirect to login if not authenticated various procedures  */}
        <Route path="/" element={isAuthenticated ? <Home /> : <Navigate to="/login" replace />} />
        <Route path="/login" element={<Login onLogin={handleLogin} />} />
        <Route path="/logout" element={<Logout onLogout={handleLogout} />} />
        <Route path="/loginempo" element={<LoginEmp onLogin={handleLogin} />} />
        <Route path="/signup" element={<SignUpEmp />} />
        <Route path="/forgot" element={<ForgotEmp  />} />
        {isAuthenticated && (
          <>
           <Route path="/Profile" element={<Profile />} />
           <Route path="/onboarding" element={<OnBoarding />} />
            <Route path="/Enroll" element={<EventManagement />} />
            <Route path="/All Students" element={<AllStudents />} />
            <Route path="/about-students" element={<AboutStudent />} />
            <Route path="/all-courses/:id" element={<AllCourses />} />
            <Route path="/fees-collections" element={<FeesCollections />} />
            <Route path="/ADD COURSES" element={<AddCourses />} />

            <Route path="/edit-courses" element={<EditCourse />} />
            <Route path="/edit-webinar" element={<EditWebinar />} />
            <Route path="/add-webinar" element={<AddWebinar />} />
            <Route path="/all-webinar" element={<AllWebinars />} />
            <Route path="/fees-receipts" element={<FeesReceipts />} />
            <Route path="/tool-and-fixture" element={<ToolAndFixtureDesign />} />
            {/* <Route path="/courses-details" element={<CoureseGetData />} /> */}
            <Route path="/courses-details/:id" element={<CoureseGetData />} />
            <Route path="/admin-edit/:adminId" element={<EditAdminData />} />
            <Route path="/webinars-details/:id" element={<WebinarsGetData />} />
            <Route path="/empty-page/:navId" element={<EmptyPage />} />
            <Route path="/empty-page/:navId" element={<EmptyPage />} />
            <Route path="/courses" element={<Courses />} />
            
            <Route path="/cntrollers-table-data" element={<ControllersTableData />} />
            
            <Route path="/admin-sidenav-data" element={<AdminSidenavdata />} />
            <Route path="/user-sidenav-data" element={<UserSidenavbar />} />
            <Route path="/add-admin" element={<AddAdmin />} />
            <Route path="/all-placements" element={<AllPlacements />} />
